import React, { Component } from "react";
import { Col, Tag } from "antd";
import styled from "styled-components";

export class MyTag extends Component {
  render() {
    return (
      <Col span={8}>
        <div
          style={{
            marginTop: "300px",
            marginBottom: "20px",
            marginLeft: "50px",
            textSize: "20px",
            color: "white",
            fontWeight: "bold",
            fontSize: "20px",
          }}
        >
          Tag:
        </div>
        <div style={{ textAlign: "center" }}>
          <Tag
            color="magenta"
            style={{ backgroundColor: "#f3f7f820", textTransform: "uppercase" }}
          >
            #Programmer
          </Tag>
          {/* <StyledTag color="red">Student</StyledTag> */}
          <Tag
            color="volcano"
            style={{ backgroundColor: "#f3f7f820", textTransform: "uppercase" }}
          >
            #Actor
          </Tag>
          {/* <Tag color="orange">orange</Tag> */}
          <Tag
            color="gold"
            style={{ backgroundColor: "#f3f7f820", textTransform: "uppercase" }}
          >
            #Guitarist
          </Tag>
          {/* <Tag color="lime">lime</Tag> */}
          <Tag
            color="green"
            style={{ backgroundColor: "#f3f7f820", textTransform: "uppercase" }}
          >
            #Student
          </Tag>
          {/* <Tag color="cyan">cyan</Tag> */}
          <Tag color="blue">#Major Economics</Tag>
          {/* <Tag color="geekblue">geekblue</Tag> */}
          {/* <Tag color="purple" visible="false">purple</Tag> */}
        </div>
      </Col>
    );
  }
}

export default MyTag;
